      } from 'reactstrap';

import QR from './images/cardQR.png';
import FadedHeader from './FadedHeader.js';
import typewriter from './images/typewriter.jpeg';
import Accordion from 'react-bootstrap/Accordion';
import Card from 'react-bootstrap/Card';

export default class Contact extends Component  {



  render() {
      return (

        <div>


          <Row>
              <Col>
                <img className="bg-contact"
                    src={typewriter}
                />
              </Col>

              <Col className="center">
                <h2> Name : Scott Lau Stubbs </h2>
                <h2>
                  <a target="_blank" rel="noopener noreferrer" href='mailto:concepttocloud@gmail.com?subject=Consultation Interest&body=I would like to consult with you to learn how C2C can help my business. Please email me back.'> Email : scott.lau.stubbs@gmail.com</a>
                </h2>

                <h2> Currently : Technical Support Engineer </h2>

                <img className="bg-contact"
                    src={QR}
                />
              </Col>

          </Row>



        </div>
      );
  }
}
